const stateDefaults = {
   danhsachGheDangDat:[

      {
         "hang": "", 
         "danhSachGhe": [
           {"soGhe":"1","gia":0},
           {"soGhe":"2","gia":0},
           {"soGhe":"3","gia":0},
           {"soGhe":"4","gia":0},
           {"soGhe":"5","gia":0},
           {"soGhe":"6","gia":0},
           {"soGhe":"7","gia":0},
           {"soGhe":"8","gia":0},
           {"soGhe":"9","gia":0},
           {"soGhe":"10","gia":0},
           {"soGhe":"11","gia":0},
           {"soGhe":"12","gia":0}
         ] 
       }
   ]


}
export const btDatVeReducer = (state= stateDefaults, action) => {
   switch (action.type) {
      default: return {...state}
   }
}
